INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (220, 467, 'geoservice', 4, 'INSPIRE View Service', 3, 'SPA-Gebiete in der Hanse- und Universitätsstadt Rostock und Umgebung', 'https://geo.sv.rostock.de/geodienste/spa_gebiete/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die SPA-Gebiete, also jene Schutzgebiete, die nach der Vogelschutzrichtlinie der Europäischen Union (EU) als Special Protection Areas (SPA) ausgewiesen wurden, in der Hanse- und Universitätsstadt Rostock und Umgebung mit Informationen zu Code (Nummer), Standarddatenbogencode in der NaturaD-Datenbank, Standarddatenbogen aus der NaturaD-Datenbank und aktuelle rechtsgültige Ausweisung.', '2015-10-01', '{"Landesamt für Umwelt, Naturschutz und Geologie Mecklenburg-Vorpommern"}', '{"Kathrin Lippert"}', '{kathrin.lippert@lung.mv-regierung.de}', 'Schutzgebiete', NULL, false, NULL);
