INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (740, 462, 'geoservice', 4, 'WMS', 8, 'Schutzgebiete in der Hanse- und Universitätsstadt Rostock und Umgebung', 'https://geo.sv.rostock.de/geodienste/schutzgebiete/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die Schutzgebiete gemäß §§ 23, 26, 29 Bundesnaturschutzgesetz (BNatSchG) in der Hanse- und Universitätsstadt Rostock und Umgebung mit Informationen zu Code (Nummer), Landeskennziffer, Kennung des Instituts für Landesforschung und Naturschutz der DDR (ILN), Bezeichnung, Landesbezeichnung, Art, Anzahl räumlich getrennter Teilflächen, Datum der ersten Unterschutzstellung, Datum der aktuellen Unterschutzstellung, Datum der aktuellen rechtsgültigen Ausweisung, Fläche in der Einheit Quadratmeter, aktuelle rechtsgültige Ausweisung, Kennziffer im Landesrechtsinformationssystem Mecklenburg-Vorpommern (LARIS M-V) und Datenblatt des Landesamtes für Umwelt, Naturschutz und Geologie Mecklenburg-Vorpommern (LUNG-MV).', '2015-10-21', '{"Landesamt für Umwelt, Naturschutz und Geologie Mecklenburg-Vorpommern"}', '{"Burkhard Neumann"}', '{burkhard.neumann@lung.mv-regierung.de}', NULL, NULL, false, NULL);
