INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (775, 490, 'geoservice', 4, 'WMS', 8, 'Uferlinie Mecklenburg-Vorpommerns', 'https://geo.sv.rostock.de/geodienste/uferlinie/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die amtliche Uferlinie Mecklenburg-Vorpommerns (Erstellung im Zeitraum von 2010 bis 2016). Sie setzt sich aus der Außenküstenlinie und der Bodden- und Haffküstenlinie zusammen. Die Festlegungen für diese amtliche Uferlinie sind administrativ getroffen worden und beruhen auf terrestrischen und satellitengestützen Vermessungen der Uferlinien bei Normalmittelwasserstand (NHN plus 1 cm bzw. HN minus 0,14 cm). Dabei wird die Außenküstenlinie als die theoretisch natürliche Verteidigungslinie gegenüber der Ostsee definiert. Sie repräsentiert einen landseitigen Linienzug von den Festlandsküsten über die Inseln und Halbinseln von der Grenze zu Schleswig-Holstein bis zur Grenze zur Republik Polen. Die sogenannten „Sprungmarken“ von einem Außenküstenabschnitt zum nächsten sind gleichzeitig die Grenze von der Außenküstenlinie zu der Bodden- und Haffküstenlinie. Diese Sprungmarken sind nach morphologischen Gesichtspunkten an den Stellen gesetzt worden, an denen bei natürlicher Küstendynamik und Sedimenttransport die Haken für die Nehrungen oder Flachküstenbildungen ansetzen würden. Die angegebene Länge der Außenküste setzt sich dabei nur aus den tatsächlichen Landteilen dieser Linie zusammen und beinhaltet nicht die wasserseitigen Verbindungslinien dazwischen. Alle terrestrischen Uferlinien, die nicht der Außenküste zugeordnet wurden, werden als Bodden- und Haffküstenlinie definiert. Die Bestimmung dieser Bodden- und Haffküstenlinie erfolgte in der Regel durch Digitalisierung der Orthophotos des des Landesamtes für innere Verwaltung Mecklenburg-Vorpommern (LAiV-MV) und wurde dann in einigen (wichtigen und zugänglichen) Abschnitten durch tachymetrische Vermessungen analog der Außenküstenlinie ersetzt. Das amtliche Bezugssystem der Lage ist das geozentrische, dreidimensionale Europäische Terrestrische Referenzsystem 1989 (ETRS89), für Mecklenburg-Vorpommern einheitlich in der Zone 33-Nord. Das amtliche Bezugssystem der Höhe ist das System Deutsches Haupthöhennetz 1992 (DHHN92). Als Bezugsellipsoid wird das Geodätische Referenzsystem 1980 (GRS80) festgelegt. Die Bezugsfläche (Quasigeoid) verläuft durch den Nullpunkt des Amsterdamer Pegels und wird als Normalhöhennull (NHN) bezeichnet. Zusatzinformationen: Messzeitraum Uferlinie Außenküstenlinie seit 2000 fortlaufend (letzte Teilmessungen 2012), Messzeitraum Uferlinien Bodden- und Haffküsten seit März 2004 forlaufend (letzte Teilmessungen 2011), Messmethoden Uferlinie Außenküstenlinie 95% mittels DGPS-Messung unter Nutzung eigener Referenzstationen und des SAPOS-HEPS-Dienstes des LAiV-MV, 5% durch tachymetrische Messungen mittels hochgenauer selbstregistrierender Totalstationen, Messmethoden Uferlinien Bodden- und Haffküsten 36% mittels DGPS-Messung unter Nutzung eigener Referenzstationen und des SAPOS-HEPS-Dienstes des LAiV-MV, 64% durch tachymetrische Messungen mittels hochgenauer selbstregistrierender Totalstationen, Messgenauigkeiten DGPS-Messung 1-2 cm Lagegenauigkeit, 2-3 cm Höhengenauigkeit, Messgenauigkeiten tachymetrische Aufnahmen 1-2 cm Lagegenauigkeit, 1-2 cm Höhengenauigkeit, verwendete GPS-Stationen Geodätischer Echtzeit-GPS-Empfänger, Leica System SR 530 mit Software SKI-Pro Leica SR 530, verwendete Totalstationen Elektrooptischer Tachymeter Leica TCRA 1102. Es wurde eine durchgehende, in sich homogene Uferlinie in der Örtlichkeit gemessen, die unabhängig vom jeweiligen Wasserstand konstant bei NHN plus 1 cm bzw. HN minus 0,14 cm liegt.', '2016-11-29', '{"Staatliches Amt für Landwirtschaft und Umwelt Mittleres Mecklenburg"}', '{"Dr. Lars Tiepolt"}', '{lars.tiepolt@stalumm.mv-regierung.de}', NULL, NULL, false, NULL);
