INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (150, 257, 'geoservice', 4, 'INSPIRE View Service', 3, 'Hochwassergefahrenkarte „Sturmflut Ostsee“ in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/hochwassergefahrenkarte_sturmflut_ostsee/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die Hochwassergefahrenkarte „Sturmflut Ostsee“ mit ungeschützten Gebieten (potentielle Überflutungsflächen ohne technischen Hochwasserschutz) und geschützten Gebieten (potentielle Überflutungsflächen hinter Schutzanlagen) in der Hanse- und Universitätsstadt Rostock bei Eintritt einer extremen Sturmflut (Pegel bis 3,00 Meter über dem Normal-Mittelwasserstand), einer sehr schweren Sturmflut (Pegel bis 2,50 Meter über dem Normal-Mittelwasserstand), einer schweren Sturmflut (Pegel bis 2,00 Meter über dem Normal-Mittelwasserstand), einer mittleren Sturmflut (Pegel bis 1,50 Meter über dem Normal-Mittelwasserstand) sowie einer Sturmflut (Pegel bis 1,00 Meter über dem Normal-Mittelwasserstand). Der Wasserstand von 2,50 Meter entspricht ungefähr einem auf statistischer Grundlage ermittelten Hochwasser mit einem Wiederkehrsintervall von 200 Jahren für die Unterwarnow im Bereich des Stadthafens. Für die nördlicher gelegenen Küstenabschnitte (Gehlsdorf bzw. Schmarl und Breitling bzw. Außenküste) liegt dieser so genannte Referenzhochwasserstand bei 2,40 Meter und 2,30 Meter über dem Normal-Mittelwasserstand.', '2017-06-29', '{"Hanse- und Universitätsstadt Rostock – Amt für Umweltschutz"}', '{"Uwe Badrow"}', '{uwe.badrow@rostock.de}', 'Gebiete mit naturbedingten Risiken', NULL, false, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (551, 305, 'geoservice', 4, 'WMS', 8, 'Bebauungspläne der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/bplaene/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die rechtskräftigen amtlichen Bebauungspläne (B-Pläne) der Hanse- und Universitätsstadt Rostock gemäß §§ 34 und 35 Baugesetzbuch (BauGB) mit Informationen zu Nummer, Bezeichnung, Art, Art der baulichen Nutzung, Bekanntmachung, Fläche in der Einheit Quadratmeter, vollständigem Bebauungsplan und Begründung.', '2018-01-02', '{"Amt für Raumordnung und Landesplanung Region Rostock"}', '{"Barbara Jatzlauk"}', '{barbara.jatzlauk@afrlrr.mv-regierung.de}', NULL, NULL, false, NULL);
