INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (172, 417, 'geoservice', 4, 'INSPIRE View Service', 3, 'Landtagswahl 2011 in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/landtagswahl_2011/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die Standorte der amtlichen Wahllokale der Landtagswahl 2011 in der Hanse- und Universitätsstadt Rostock vom 04.09.2011 mit Informationen zu Adresse, Wahlbezirksnummer(n), Lokalität und Barrierefreiheit sowie die amtlichen Wahlbezirke der Landtagswahl 2011 in der Hanse- und Universitätsstadt Rostock vom 04.09.2011 mit Informationen zu Nummer.', '2017-01-13', '{"Hanse- und Universitätsstadt Rostock – Hauptamt"}', '{"Petra Guljam"}', '{petra.guljam@rostock.de}', 'Statistische Einheiten', NULL, false, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (639, 257, 'geoservice', 4, 'WMS', 8, 'Hochwassergefahrenkarte „Sturmflut Ostsee“ in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/hochwassergefahrenkarte_sturmflut_ostsee/wms', true, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die Hochwassergefahrenkarte „Sturmflut Ostsee“ mit ungeschützten Gebieten (potentielle Überflutungsflächen ohne technischen Hochwasserschutz) und geschützten Gebieten (potentielle Überflutungsflächen hinter Schutzanlagen) in der Hanse- und Universitätsstadt Rostock bei Eintritt einer extremen Sturmflut (Pegel bis 3,00 Meter über dem Normal-Mittelwasserstand), einer sehr schweren Sturmflut (Pegel bis 2,50 Meter über dem Normal-Mittelwasserstand), einer schweren Sturmflut (Pegel bis 2,00 Meter über dem Normal-Mittelwasserstand), einer mittleren Sturmflut (Pegel bis 1,50 Meter über dem Normal-Mittelwasserstand) sowie einer Sturmflut (Pegel bis 1,00 Meter über dem Normal-Mittelwasserstand). Der Wasserstand von 2,50 Meter entspricht ungefähr einem auf statistischer Grundlage ermittelten Hochwasser mit einem Wiederkehrsintervall von 200 Jahren für die Unterwarnow im Bereich des Stadthafens. Für die nördlicher gelegenen Küstenabschnitte (Gehlsdorf bzw. Schmarl und Breitling bzw. Außenküste) liegt dieser so genannte Referenzhochwasserstand bei 2,40 Meter und 2,30 Meter über dem Normal-Mittelwasserstand.', '2017-06-29', '{"Hanse- und Universitätsstadt Rostock – Amt für Umweltschutz"}', '{"Uwe Badrow"}', '{uwe.badrow@rostock.de}', NULL, NULL, false, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (272, 272, 'geoservice', 4, 'WCS', 6, 'Wärmebedarfsraster in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/waermebedarfsraster/wcs', true, true, '2018-03-23 16:15:01+01', 'Diese Daten umfassen den spezifischen Wärmebedarf der Gebäude in der Hanse- und Universitätsstadt Rostock in der Einheit Kilowattstunden je Quadratmeter und Jahr als Raster mit Zellen von jeweils 200 mal 200 Metern (4 Hektar) Flächengröße.', '2017-08-18', '{"Hanse- und Universitätsstadt Rostock – Amt für Umweltschutz"}', '{"Andrea Arnim"}', '{andrea.arnim@rostock.de}', NULL, NULL, true, NULL);
