INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (257, 257, 'geoservice', 4, 'WCS', 6, 'Hochwassergefahrenkarte „Sturmflut Ostsee“ in der Hanse- und Universitätsstadt Rostock', 'https://geo.sv.rostock.de/geodienste/hochwassergefahrenkarte_sturmflut_ostsee/wcs', true, true, '2018-03-23 16:15:01+01', 'Diese Daten umfassen die Hochwassergefahrenkarte „Sturmflut Ostsee“ mit ungeschützten Gebieten (potentielle Überflutungsflächen ohne technischen Hochwasserschutz) und geschützten Gebieten (potentielle Überflutungsflächen hinter Schutzanlagen) in der Hanse- und Universitätsstadt Rostock bei Eintritt einer extremen Sturmflut (Pegel bis 3,00 Meter über dem Normal-Mittelwasserstand), einer sehr schweren Sturmflut (Pegel bis 2,50 Meter über dem Normal-Mittelwasserstand), einer schweren Sturmflut (Pegel bis 2,00 Meter über dem Normal-Mittelwasserstand), einer mittleren Sturmflut (Pegel bis 1,50 Meter über dem Normal-Mittelwasserstand) sowie einer Sturmflut (Pegel bis 1,00 Meter über dem Normal-Mittelwasserstand). Der Wasserstand von 2,50 Meter entspricht ungefähr einem auf statistischer Grundlage ermittelten Hochwasser mit einem Wiederkehrsintervall von 200 Jahren für die Unterwarnow im Bereich des Stadthafens. Für die nördlicher gelegenen Küstenabschnitte (Gehlsdorf bzw. Schmarl und Breitling bzw. Außenküste) liegt dieser so genannte Referenzhochwasserstand bei 2,40 Meter und 2,30 Meter über dem Normal-Mittelwasserstand.', '2017-06-29', '{"Hanse- und Universitätsstadt Rostock – Amt für Umweltschutz"}', '{"Uwe Badrow"}', '{uwe.badrow@rostock.de}', NULL, NULL, true, NULL);
INSERT INTO links (id, parent_id, category, category_order, "group", group_order, title, link, public, reachable, reachable_last_check, description, date, authorship_organisation, authorship_name, authorship_mail, inspire_annex_theme, logo, search, search_title) VALUES (597, 350, 'geoservice', 4, 'WMS', 8, 'Fluren in Mecklenburg-Vorpommern', 'https://geo.sv.rostock.de/geodienste/fluren_mv/wms', false, true, '2018-03-23 16:15:01+01', 'Diese Karte umfasst die Fluren in Mecklenburg-Vorpommern mit Informationen zu Gemarkung und Flur.', '2018-03-23', '{"Landkreis Rostock – Kataster- und Vermessungsamt","Landkreis Ludwigslust-Parchim – Vermessung und Geoinformation","Landkreis Mecklenburgische Seenplatte – Zentrale Dienste","Landkreis Nordwestmecklenburg – Kataster und Vermessung","Landkreis Vorpommern-Greifswald – Kataster- und Vermessungsamt","Landkreis Vorpommern-Rügen – Kataster und Vermessung"}', '{"Holger Riedel","Manuel Schulz","Martin Zielke","Frank Holzapfel","Andreas Wirsing","Ronald Günther"}', '{holger.riedel@lkros.de,manuel.schulz@kreis-lup.de,martin.zielke@lk-seenplatte.de,f.holzapfel@nordwestmecklenburg.de,andreas.wirsing@kreis-vg.de,ronald.guenther@lk-vr.de}', NULL, NULL, false, NULL);
